import './name.css';
import Yourname  from './yourname';

function Myname(props){
    return (
    <div className="gen"> 
        <div className='tandm'>
            <h2>{props.title}</h2>
            <div className="mount">
                <h2>{props.amount}</h2>
            </div>
        </div>

        <div>
        <Yourname date = {props.date}
        />
        </div>      

    </div>);
}
export default Myname;
